import React, { Component } from 'react'
import { connect } from 'react-redux'
import { BrowserRouter as Router, Route } from 'react-router-dom'
import { handleUsersInitialData } from '../actions/shared'
import { handleQuestionsInitialData } from '../actions/shared'
import './App.css';
import Login from './Login'
import QuestionList from './QuestionList'
import LeaderBoard from './LeaderBoard'
import AddQuestion from './AddQuestion'


class App extends Component {

  componentDidMount () {
    this.props.dispatch(handleUsersInitialData())
    this.props.dispatch(handleQuestionsInitialData())
  }
  render() {

      return (
        // TODO block all others adresses by 404 error
        <Router>
          <div className="App">
           <Route path='/' exact component={QuestionList } />
           <Route path='/login' component={Login} />
           <Route path='/leader' component={LeaderBoard} />
           <Route path='/addQuestion' component={AddQuestion} />
          </div>
        </Router>
      )
  }
}
function mapStateToProps({authedUser}) {
  return {
    authedUserID: authedUser
  }
}

export default connect(mapStateToProps)(App);
